import React, {useState, useEffect} from 'react'

function Webapp(){

  useEffect(() => {
    const Init = {
      method: 'GET',
      headers: {
         'accept': 'application/json',
         'AccountKey': 'b5NRmQ28QUSAE/qVP8jx2g==',
      },
      credentials: 'include',
    }
    fetch('http://datamall2.mytransport.sg/ltaodataservice/BusArrivalv2?BusStopCode=66211', Init)
      .then(
          response => response.json()
        )
      .then(jsondata => console.log(jsondata))
    .catch(console.log)
  })

  return(
    <div className="section middle-container">
      <h1>Nextbus</h1>
    </div>
  )
}

export default Webapp
